description:
Chloe 2009

Verenigde Staten / Canada
Drama / Thriller
99 minuten

geregisseerd door Atom Egoyan
met Liam Neeson, Amanda Seyfried en Julianne Moore

Catherine (Julianne Moore), een succesvolle dokter, vermoedt 
dat haar man David (Liam Neeson) vreemd gaat. Om daar achter 
te komen huurt ze de onweerstaanbare jonge vrouw, Chloe (Amanda Seyfried) 
in. Chloe's verhalen over haar opwindende ontmoetingen met David brengen 
Catherine in verleiding om haar eigen sensualiteit opnieuw te ontdekken, 
maar ze realiseert zich niet in welke problemen ze haar hele familie 
brengt...

